import React from "react";
import img from "../../../public/Images/AG-logo.png";
import "./style.css";

function Header() {
    return (
        <div className="header row z-depth-4">
            <span className="col s4 push-s4"><img src={img}></img></span>
        </div>
    );
}

export default Header;
